import './App.css';
import Header from './Header';

const compromissos = ['fazer atividades físicas', 'imprimir procurações', 'comprar lâmpadas e bicicletário'];

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

function App() {
  return (
    <div className="App">
      { compromissos.map((xablau) => Task(xablau)) }
    </div>
  );
}

export default App;
